Mongodb Merging/Joining Nested Objects<p>I've looked up a lot to find a solution. But I am unable to form a solution to my problem.<br />
I have two MongoDB (Node.JS) collections: <code>user</code> &amp; <code>statistics</code>. I'm trying to merge the results through aggregate.</p>
<p>Here are the structures of the collections:<br />
<strong>user</strong></p>
<pre class="lang-js prettyprint-override"><code>{
    _id: 602baa4e38e6de8e08737557,
    id: '50496531082300001',
    data: {
        avatar: 'https://example.com/test.png',
        username: 'John Doe',                                                                                                                                                                                                            
    }
},
{
    _id: 602baa4602baa4e38e6de58,
    id: '50496531082300002',
    data: {
        avatar: 'https://example.com/test2.png',
        username: 'Rebecca Jones',                                                                                                                                                                                                            
    }
},
</code></pre>
<p><strong>statistics</strong></p>
<pre class="lang-js prettyprint-override"><code>{
    _id: 4e38e6de8e0873755778755,
    id: '456789987654345678',
    data: {
        members: {
            '50496531082300001' : {
                messages: 20,
                emails: 200
            },
            '50496531082300002' : {
                messages: 40,
                emails: 400
            },
        }
    }
},
</code></pre>
<p>So I'm trying to merge the <code>data</code> from <code>user</code> and the key-pair value <code>data.members</code> from <code>statistics</code>.<br />
But the issue here is, <code>id</code> of <code>user</code> has to match keys of <code>data.members</code> from <code>statistics</code>, and I cant find a way to do it.</p>
<p><strong>Expected Output</strong></p>
<pre class="lang-js prettyprint-override"><code>'50496531082300001' : {
    messages: 20,
    emails: 200,
    avatar: 'https://example.com/test.png',
    username: 'John Doe'
},
'50496531082300002' : {
    messages: 40,
    emails: 400,
    avatar: 'https://example.com/test2.png',
    username: 'Rebecca Jones',
},
</code></pre>

