</code></pre>
<p>In my react app, I'm using a search bar component which makes DB queries based on a keyword (in the above example, 'category' and 'name' are both keys in a MongoDB model).  With the above, I can only access the second on the list, i.e. 'category'.  Bizarrely this worked fine with the above syntax until this morning, so I don't know what I've changed.  The only other file I've changed is .css so I doubt there's anything at fault there.</p>
<p>Is there a way to access both at once?</p>
<p>Thanks in advance</p>

