I believe unwind operator could be of some use here but not sure how to progress with next steps.</p>; Answer: Grant Wagners solution starts the screensaver and then locks the screen, but the lock causes the screensaver to exit.

This solution is just starting the screensaver without explicitely locking it, so it takes a few seconds before it is locked by windows.

Reversing the order of Grant Wagners solution (calling LockWorkStation before SendMessage) fixes both problems, the screen is locked immediately and the screensaver is started after it.

